import Stories from "./Stories"
import Post from "./Posts"
import Sidebar from "./Sidebar"

const  story = [
    {username: "9gag"},
    {username: "meowed"},
    {username: "barked"},
    {username: "nathanwpylestrangeplanet"},
    {username: "wawawicomics"},
    {username: "respondeai"},
    {username: "filomoderna"},
    {username: "memeriagourmet"}
]

const post = [
    {
        username: "",
        img: "",
        likes: "",
        text: ""
    },

    {
        username: "",
        img: "",
        likes: "",
        text: ""
    },

    {
        username: "",
        img: "",
        likes: "",
        text: ""
    },
]

export default function Content(){
    return (
        <div class="corpo">
            <div class="esquerda">
                <div class="stories">
                    {story.map((story) => (
                        <Stories username={story.username} />
                    ))}
                </div>

                <div class="posts">
                    {post.map((post) => (
                        <Post user={post.username} img={post.img} likes={post.likes} text={post.text} />
                    ))}
                </div>


            </div>

            <div class="sidebar">
                <Sidebar />
            </div>
        </div>
    )
}
